(4432, 'default', 'created', 'App\\Models\\Season', 9, 'App\\Models\\User', 1, '{\"attributes\":{\"id\":9,\"title\":\"Season 2\",\"description\":\"Welcome to Season 2 of \\\"Marriage Is?\\\"\\u2014the groundbreaking reality TV show that delves deep into the complexities of modern-day relationships! In this riveting season, we bring together four married couples for candid round table discussions on the most pivotal topics affecting marriages today. From the secrets of success to reigniting the flame, managing finances, and navigating conflicts with grace, no stone is left unturned.\\r\\n\\r\\nJoin us as these couples bare their souls, sharing their triumphs, trials, and intimate insights into what makes their marriages work\\u2014or struggle. With raw honesty and unwavering vulnerability, they tackle the toughest questions, offering viewers a rare glimpse into the inner workings of real-life partnerships.\\r\\n\\r\\nFrom heartwarming moments of connection to fiery debates and unexpected revelations, \\\"Marriage Is?\\\" Season 2 promises to be a rollercoaster ride of emotions. Whether you\'re single, in a relationship, or married yourself, prepare to be inspired, challenged, and empowered by the unfiltered wisdom and authenticity of these courageous couples.\\r\\n\\r\\nSo grab a seat at the table and join the conversation as we explore the true meaning of love, commitment, and what it takes to make a marriage thrive in today\'s world. Because when it comes to love, \\\"Marriage Is?\\\" more than just a journey\\u2014it\'s an adventure of a lifetime.\",\"year\":2024,\"trailer\":\"https:\\/\\/youtu.be\\/tqbwUwO3TXA\",\"status\":1,\"adult\":1,\"top_scroll\":0,\"new_release\":0,\"upcoming\":0,\"date_sort\":\"2024-02-15 00:00:00\",\"user_id\":1,\"show_id\":1,\"created_at\":\"2024-03-25T19:29:34.000000Z\",\"updated_at\":\"2024-03-25T19:29:34.000000Z\"}}', '2024-03-25 20:29:34', '2024-03-25 20:29:34'),
