(2, 'Episode 2 - Sex', 'In this episode, we talk about all things SEX!', '1h 35min 54sec', 1, 1, 1, 'external_link', 'https://notisstreaming.s3.us-east-2.amazonaws.com/TVShows/MarriageIs/MarrageIsSE1/Marriage_Is_Ep-2.mp4', '2023-01-21 20:37:00', 'https://www.youtube.com/watch?v=A1tJVupLPsg', 1, 1, -1, '2023-01-23 01:38:10', '2024-03-25 21:04:59'),
