(31, 'New Level - E01', 'Join Lacretia & Chai Mitchell as they take you on a captivating journey into the world where love and real estate converge. Explore the highs and challenging lows of building a lasting legacy, as they partner with others to create something out of nothing brick by brick. Discover how love propels them to a new level in relationships, family, and the realm of real estate. Get ready for inspiration, insights, and a heartfelt exploration into the limitless possibilities.', '15m 55s', 1, 1, 0, 'external_link', 'https://notisstreaming.s3.us-east-2.amazonaws.com/TVShows/IntestingInLove/InvestingInLoveSE01/Investing+In+Love+Ep+1+-+New+Level.mp4', '2023-12-01 12:00:00', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/xeAXxXxk_AI?si=TbGjmTryyc6HJGCH\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen></iframe>', 1, 8, -1, '2024-03-25 20:45:35', '2024-03-25 20:45:35'),
(32, 'Against The Current - E02', 'Join Lacretia & Chai Mitchell as they take you on a captivating journey into the world where love and real estate converge. Explore the highs and challenging lows of building a lasting legacy, as they partner with others to create something out of nothing brick by brick. Discover how love propels them to a new level in relationships, family, and the realm of real estate. Get ready for inspiration, insights, and a heartfelt exploration into the limitless possibilities.', '19m 10s', 1, 1, 0, 'external_link', 'https://notisstreaming.s3.us-east-2.amazonaws.com/TVShows/IntestingInLove/InvestingInLoveSE01/Investing+In+Love+Ep+2+-+Against+The+Current.mp4', '2323-12-08 12:00:00', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/xeAXxXxk_AI?si=TbGjmTryyc6HJGCH\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen></iframe>', 1, 8, -1, '2024-03-25 20:46:42', '2024-03-25 20:51:09'),
(33, 'Brick By Brick - E03', 'Join Lacretia & Chai Mitchell as they take you on a captivating journey into the world where love and real estate converge. Explore the highs and challenging lows of building a lasting legacy, as they partner with others to create something out of nothing brick by brick. Discover how love propels them to a new level in relationships, family, and the realm of real estate. Get ready for inspiration, insights, and a heartfelt exploration into the limitless possibilities.', '15m 55s', 1, 1, 0, 'external_link', 'https://notisstreaming.s3.us-east-2.amazonaws.com/TVShows/IntestingInLove/InvestingInLoveSE01/IILEP03.mp4', '2023-12-15 12:00:00', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/xeAXxXxk_AI?si=TbGjmTryyc6HJGCH\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen></iframe>', 1, 8, -1, '2024-03-25 20:48:50', '2024-03-25 20:48:50'),
(34, 'Episode 1 - Meet The Couples', 'Welcome to the premiere episode of \"Marriage Is?\" Season 2! Get ready to meet our dynamic couples and hear their heartwarming stories of love and connection.\r\nJoin us as these couples share the magical moments when they knew they had found \'the one\' and embark on their journey of love, growth, and partnership. Get ready to be inspired by their stories of serendipity, destiny, and unwavering devotion.', '13m 51s', 1, 1, 1, 'external_link', 'https://notisstreaming.s3.us-east-2.amazonaws.com/TVShows/MarriageIs/MarrageIsSE2/MarriageISE2EP01.mp4', '2024-02-15 00:00:00', 'https://youtu.be/tqbwUwO3TXA', 1, 9, -1, '2024-03-25 21:14:10', '2024-03-25 21:14:10'),
(35, 'Episode 2 - Keeping The Flame Burning', 'In Episode 2 of \"Marriage Is?\" Season 2, the spotlight shifts to the essential topic of \"Keeping the Flame Going.\" As our couples delve into this intimate discussion, they confront the challenges and triumphs of maintaining passion and connection in their relationships. From spontaneous date nights to heartfelt gestures and rediscovering the spark that first ignited their love, each couple shares their unique strategies for reigniting the flame and keeping their bond alive amidst the chaos of everyday life. With candid revelations and heartfelt anecdotes, Episode 2 offers a poignant exploration of the enduring power of love and the importance of nurturing the flames of passion in marriage. Tune in for an insightful and heartwarming journey into the heart of romance and commitment.', '52m 46s', 1, 1, 1, 'external_link', 'https://notisstreaming.s3.us-east-2.amazonaws.com/TVShows/MarriageIs/MarrageIsSE2/MarriageISE2EP02.mp4', '2024-02-22 12:00:00', 'https://youtu.be/tqbwUwO3TXA', 1, 9, -1, '2024-03-25 21:16:49', '2024-03-25 21:20:33'),
