INSERT INTO `equipment` (`id`, `name`, `purchase_type`, `price_type`, `price_hourly`, `price_daily`, `description`, `top_bar`, `featured`, `new_arrival`, `best_selling`, `top_rated`, `require_room`, `category_id`, `status`, `seperate_page`, `quantity`, `created_at`, `updated_at`) VALUES
(4, 'URSA MINI PRO G2', 'rent', 'day', 0, 65, '<p>URSA Mini Pro 4.6K G2 is a next generation digital film camera with updated electronics and a high performance 4.6K HDR image sensor for shooting at up to 300 frames per second. You get a Super 35mm 4.6K sensor with 15 stops of dynamic range, built in optical ND filters, interchangeable EF lens mount that can be swapped for optional PL, B4 or F mounts, Blackmagic RAW and ProRes recording to dual CFast or dual SD cards, and an innovative USB-C expansion port for recording directly to external disks. In addition, URSA Mini Pro 4.6K G2 features a massive set of external broadcast style controls, backlit status display, foldout touchscreen monitor and more!</p>', 0, 0, 0, 0, 0, 1, 9, 1, 0, 1, '2023-04-21 14:36:43', '2023-06-21 12:26:30'),
(5, 'RED EPIC DRAGON 6K', 'rent', 'day', 0, 100, '<p>The Red Dragon sensor is a 19 megapixel sensor that captures video stills at up to 6K resolution. The sensor captures over nine times more resolution than standard 1080p HD video. This results in native exposure that exceeds 35mm film in both latitude and image density, comparing only to 65mm in image density. The Red Epic Dragon camera supports high speed frames rates (300 FPS+), 16.5 stops of dynamic range and advance color science.</p>', 0, 0, 0, 0, 0, 1, 10, 1, 0, 1, '2023-04-21 15:00:26', '2023-04-21 15:00:26'),
(6, 'ARRI ALEXA CLASSIC', 'rent', 'day', 0, 100, '<p>The Alexa EV \"Classic\" is a PL or EF mounted digital cinema camera with an Arri Super35 Alexa sensor that can shoot high resolution ProRes footage up to 2K and is complete with a high speed license upgrade.</p>', 0, 0, 0, 0, 0, 1, 11, 1, 0, 1, '2023-04-21 15:02:38', '2023-04-21 15:02:38'),
(7, 'BLACKMAGIC PCC 6K', 'rent', 'day', 0, 25, '<p>The Blackmagic Pocket Cinema Camera 6K G2 is an advanced technology, handheld 6K digital film camera with 6144 x 3456 Super 35 high resolution HDR sensor, dual native ISO, EF lens mount and direct recording to USB-C disks! This powerful model adds an adjustable touchscreen, and a larger battery for longer run time.</p>', 0, 0, 0, 0, 0, 1, 9, 1, 0, 1, '2023-04-21 15:08:17', '2023-04-21 15:08:17'),
(8, 'BLACKMAGIC MICRO CAM', 'rent', 'day', 0, 15, '<p>The Blackmagic Micro Cinema Camera is a miniature digital camera with a Super 16mm-sized sensor designed to be operated remotely and capture footage from virtually anywhere. The image sensor supports 1080p video up to 60 fps and 13 stops of dynamic range.</p>', 0, 0, 0, 0, 0, 1, 9, 1, 0, 1, '2023-04-21 15:09:39', '2023-04-21 15:11:03'),
(9, 'DJI MAVIC AIR 2', 'rent', 'day', 0, 20, '<p>The&nbsp;<a href=\"https://click.dji.com/AAP3nX9zA5NkZrRtQCJV-w?as=0001&amp;pm=custom\" rel=\"noopener noreferrer\" target=\"_blank\">DJI Mavic Air 2</a>&nbsp;can shoot in 4K at 60 frames per second. The new camera also records video at 120 Mbps bitrate (up from 100 Mbps), beating other DJI consumer models. Additionally, the camera can capture 1080p slow-motion video at 120 and 240 fps.</p>', 0, 0, 0, 0, 0, 1, 13, 1, 0, 1, '2023-04-21 15:22:24', '2023-04-21 15:22:24'),
(10, 'Zeiss Cp 2 Set (21, 35, 50, 85)', 'rent', 'day', 0, 100, '<p>ZEISS Compact Prime Lenses in the CP. 2 EF Mount family deliver a wide range of focal lengths, full-frame coverage, high-quality images, great flare suppression, and precise focusing through the large rotation angle. </p>', 1, 0, 1, 0, 0, 1, 14, 1, 0, 1, '2023-05-24 11:11:34', '2023-05-24 11:39:58'),
(11, 'Zeiss Cp 2 21mm', 'rent', 'day', 0, 30, '<p>The ZEISS 21mm T/2.9 CP. 2 Compact Prime Cine Lens with EF Mount is a 21mm fixed focal length lens with a flexible design so that it can be used on both cinema and DSLR cameras. An interchangeable mount for PL, EF, F, E and MFT mounts allows you to use the cine lens with movie cameras and HDSLR cameras.</p>', 0, 0, 0, 0, 0, 1, 14, 1, 0, 1, '2023-05-24 11:25:48', '2023-05-24 11:40:13'),
(12, 'Zeiss Cp 2 35mm', 'rent', 'day', 0, 30, '<p>The ZEISS Compact Prime CP.2 35mm/T1.5 Super Speed EF Mount with Imperial Markings is a fast cine prime lens designed for filmmaking and video production applications. It shoots remarkably well in low-light. Aside from great optics and mechanics, the lens offers broad flexibility in the areas of camera compatibility, follow-focus compatibility, and shooting capacity.</p>', 0, 0, 0, 0, 0, 1, 14, 1, 0, 1, '2023-05-24 11:30:30', '2023-05-24 11:40:36'),
(13, 'Zeiss Cp 2 50mm', 'rent', 'day', 0, 30, '<p>The ZEISS Compact Prime CP.2 50mm/T2.1 Cine Lens (EF Mount) is part of the second generation of CP cinema lenses that were the first to offer full-frame 35mm coverage of large sensor DSLRs (such as the Canon 5D Mark II). What distinguishes the CP.2 from its PL-mount-only predecessor is its interchangeable lens mount, which allows the included Canon EF mount to be easily swapped out for an optional Nikon F or cinema-standard PL mount. For the first time, a single, affordable, professional quality lens can be used on both cinema and still cameras, opening up creative possibilities that keep your rig lightweight, versatile, and on budget.</p>', 0, 1, 0, 1, 0, 1, 14, 1, 0, 1, '2023-05-24 11:31:11', '2023-05-24 11:42:14'),
(14, 'Zeiss Cp 2 85mm', 'rent', 'day', 0, 30, '<p>The ZEISS Compact Prime CP. 2 85mm/T1. 5 Super Speed EF Mount with Imperial Markings is a fast cine prime lens designed for filmmaking and video production applications. It shoots remarkably well in low-light.</p>', 0, 1, 0, 0, 0, 1, 14, 1, 0, 1, '2023-05-24 11:39:09', '2023-05-24 11:39:09'),
(15, 'Dracast X Light Package', 'rent', 'day', 0, 100, '<p>3 light package, the X Series is the newest compact LED panel light from Dracast. The X Series is designed with portability in mind. The panel includes an installed mounting yoke with a 5/8″ baby pin receiver for fast and easy mounting on compatible light stands or C clamps. The X Series features full spectrum RGB, plus adjustable white color temperature from 3200K to 5600K CCT. Also included are preset color gels and filters, as well as a collection of customizable effects and presets.</p>', 1, 0, 1, 0, 0, 1, 18, 1, 0, 1, '2023-05-24 11:53:36', '2023-05-24 19:51:24'),
(16, 'Zeiss Cp 2 35mm', 'rent', 'day', 0, 30, '<p>The ZEISS Compact Prime CP.2 35mm/T1.5 Super Speed EF Mount with Imperial Markings is a fast cine prime lens designed for filmmaking and video production applications. It shoots remarkably well in low-light. Aside from great optics and mechanics, the lens offers broad flexibility in the areas of camera compatibility, follow-focus compatibility, and shooting capacity.</p>', 0, 0, 0, 1, 0, 1, 14, 1, 0, 1, '2023-05-24 11:59:32', '2023-05-24 11:59:32'),
(17, 'Zeiss Cp 2 85mm', 'rent', 'day', 0, 30, '<p>The ZEISS Compact Prime CP. 2 85mm/T1. 5 Super Speed EF Mount with Imperial Markings is a fast cine prime lens designed for filmmaking and video production applications. It shoots remarkably well in low-light.</p>', 0, 0, 0, 0, 0, 1, 14, 1, 0, 1, '2023-05-24 12:03:18', '2023-05-24 12:03:18'),
(18, 'Godox Knowled M600BI Bi Color LED Video Light', 'rent', 'day', 0, 80, '<p>This Knowled M600Bi Bi-Color LED Monolight from Godox checks off about every box on your wish list. The light has a wide adjustable color temperature range from 2800 to 6500K, backed by high CRI/TLCI ratings of 96/97 to ensure accurate rendition of color.</p>', 0, 1, 1, 0, 0, 1, 19, 1, 0, 1, '2023-05-24 12:11:26', '2023-05-24 13:08:38'),
(19, 'Godox vl300', 'rent', 'day', 0, 30, '<p>The VL300 LED Video Light from Godox is a lightweight and compact LED monolite-style light source suitable for portrait, still life, and location photography, and also for video-based applications. The daylight-balanced COB LED features a CRI rating of 96 and TLCI rating of 95, producing highly accurate color renditions and rendering extremely realistic flesh tones. The VL300 light body is operated and powered from an external controller, keeping it compact and lightweight. It features a whisper-quiet fan and an integrated Bowens-style reflector mount, making it compatible with a wide array of light modifiers.</p>', 0, 0, 0, 0, 0, 1, 19, 1, 0, 1, '2023-05-24 18:20:03', '2023-05-24 18:20:03'),
(20, 'Godox SL60', 'rent', 'day', 0, 10, '<p>A versatile constant light source well-suited for video work, this SL-60 LED Light from Godox is a daylight-balanced, 5600K light featuring a COB (chip on board) LED for high brightness and color accuracy. The intuitive design of the light incorporates a rear LCD monitor and a dial with a 10-100% dimming adjustment.</p>', 0, 0, 0, 0, 0, 1, 19, 1, 0, 1, '2023-05-24 18:32:19', '2023-05-24 18:32:19'),
(21, 'Godox Knowled M600BI Bi Color LED Video Light', 'rent', 'day', 0, 80, '<p>This Knowled M600Bi Bi-Color LED Monolight from Godox checks off about every box on your wish list. The light has a wide adjustable color temperature range from 2800 to 6500K, backed by high CRI/TLCI ratings of 96/97 to ensure accurate rendition of color.</p>', 0, 0, 0, 0, 0, 1, 19, 1, 0, 1, '2023-05-24 18:50:17', '2023-05-24 18:50:17'),
(22, 'Godox SL60', 'rent', 'day', 0, 10, '<p>A versatile constant light source well-suited for video work, this SL-60 LED Light from Godox is a daylight-balanced, 5600K light featuring a COB (chip on board) LED for high brightness and color accuracy. The intuitive design of the light incorporates a rear LCD monitor and a dial with a 10-100% dimming adjustment.</p>', 0, 0, 0, 0, 0, 1, 19, 1, 0, 1, '2023-05-24 18:58:47', '2023-05-24 18:58:47'),
(23, 'Godox 6ft TL180 RGBWW Tube Light', 'rent', 'day', 0, 30, '<p>Low-profile, self-contained and portable, TL180 is a 180cm RGBWW tube light designed to benefit filmmakers, content creators, videographers and photographers. As the latest member of Godox tube light TL series, it\'s more powerful and with a larger light-emitting area, giving more liberty to your creation.</p>', 0, 0, 0, 0, 0, 1, 19, 1, 0, 1, '2023-05-24 19:03:08', '2023-05-24 19:03:08'),
(24, 'Godox 6ft TL180 RGBWW Tube Light', 'rent', 'day', 0, 30, '<p>Low-profile, self-contained and portable, TL180 is a 180cm RGBWW tube light designed to benefit filmmakers, content creators, videographers and photographers. As the latest member of Godox tube light TL series, it\'s more powerful and with a larger light-emitting area, giving more liberty to your creation.</p>', 0, 0, 0, 0, 0, 1, 19, 1, 0, 1, '2023-05-24 19:05:52', '2023-05-24 19:05:52'),
(25, 'Godox TL120 RGB Tube Light 4 light Kit', 'rent', 'day', 0, 65, '<p>Unleash your inner creativity and light the scene with the TL120 4-Light Kit from Godox. The kit contains four tube lights, a remote control with a 164\' range, four AC adapters, eight mounting clips, and a hard case for extra protection during storage and transport. Offering advanced color controls and multiple wireless and tethered control options, each light outputs up to 685 lux at 3.3\' (5600K) and features a variable color temperature range from 2700 to 6500K for both still and video applications alike. A step-up in size from the TL30 and TL60 tube lights, the fixture\'s 4\' length lets you easily light larger areas, while also offering a stackable design for a myriad of unique mounting options.</p>', 0, 0, 0, 0, 0, 1, 19, 1, 0, 1, '2023-05-24 19:10:00', '2023-05-24 19:10:00'),
(26, 'Godox RGB Mini', 'rent', 'day', 0, 5, '<p>Dress up your video background and atmosphere with this RGB Mini Creative M1 On-Camera Video LED Light from Godox. The pocket-sized light allows you to adjust hue and saturation from 360 colors when in RGB mode, and the color temperature is adjustable from 2500 to 8500K to match an ambient light source. There are also 15 special effect modes and 40 presets that add speed and creativity to your shoot. It is rated with a high CRI of 97 that ensures natural and accurate color rendering.</p>', 0, 0, 0, 0, 0, 1, 19, 1, 0, 1, '2023-05-24 19:14:48', '2023-05-24 19:14:48'),
(27, 'Godox RGB Mini', 'rent', 'day', 0, 5, '<p>Dress up your video background and atmosphere with this RGB Mini Creative M1 On-Camera Video LED Light from Godox. The pocket-sized light allows you to adjust hue and saturation from 360 colors when in RGB mode, and the color temperature is adjustable from 2500 to 8500K to match an ambient light source. There are also 15 special effect modes and 40 presets that add speed and creativity to your shoot. It is rated with a high CRI of 97 that ensures natural and accurate color rendering.</p>', 0, 0, 0, 0, 0, 1, 19, 1, 0, 1, '2023-05-24 19:15:36', '2023-05-24 19:15:36'),
(28, 'GVM RGB LED Panels', 'rent', 'day', 0, 20, '<p>Included are three 10.6 x 10.3 x 1.6\" LED panels with CCT and RGB color control. Each panel comes with a 110-240 VAC adapter, a power cord, a soft diffuser, a set of barndoors, and a 7\' light stand. A case is included to carry the kit.</p>', 0, 0, 0, 0, 0, 1, 20, 1, 0, 1, '2023-05-24 19:21:26', '2023-05-24 19:21:26'),
(29, 'Godox FLS10 Fresnel Lens', 'rent', 'day', 0, 5, '<p><span style=\"background-color: rgba(65, 128, 255, 0.18); color: rgb(5, 10, 30);\">It maximizes light output while maintaining light quality and renders consistent light with smooth intensity</span>. It increases the maximum output of the light to 46,400 lux at 9.8\' and lets you steplessly adjust the beam angle between 10° spot and 35° flood.</p>', 0, 0, 0, 0, 0, 1, 19, 1, 0, 1, '2023-05-24 19:29:04', '2023-05-24 19:29:04'),
(30, 'Godox Light Dome', 'rent', 'day', 0, 5, '<p>Bowens mount light dome.</p>', 0, 0, 0, 0, 0, 1, 19, 1, 0, 1, '2023-05-24 19:36:00', '2023-05-24 19:36:00'),
(31, 'Godox Light Dome', 'rent', 'day', 0, 5, '<p>Bowens mount light dome.</p>', 0, 0, 0, 0, 0, 1, 19, 1, 0, 1, '2023-05-24 19:41:16', '2023-05-24 19:41:16'),
(32, 'Combo Stand multiple', 'rent', 'day', 0, 15, '<p>Hello World!</p>', 0, 1, 0, 0, 0, 1, 22, 1, 0, 5, '2023-05-25 05:23:28', '2023-06-21 12:26:44'),
(33, 'Combo Stand', 'rent', 'day', 0, 15, '<p>Combo Stand has \"Rocky Mountain\" Leg for easy leveling on rough terrain. Also known as a junior, reflector stand or 2k light stand. Features 1 1/8\" receiver and 5/8\" pop up baby pin. Known as a \"combo stand\" as it can be used as either a baby or junior stand.</p>', 0, 0, 0, 0, 0, 1, 22, 1, 0, 1, '2023-05-25 05:28:51', '2023-05-25 05:28:51'),
(34, 'C-Stand', 'rent', 'day', 0, 5, '<p>A C-Stand is a metal stand designed to position lights, silks, flags, backdrops, and other tools on a set. C-Stand is believed to be short for Century Stand because they were used in early cinema to hold sun reflectors that were 100 square known as Centuries.</p>', 0, 0, 0, 1, 0, 1, 22, 1, 0, 1, '2023-05-25 05:34:05', '2023-05-25 05:34:05'),
(35, 'C-Stand', 'rent', 'day', 0, 5, '<p>A C-Stand is a metal stand designed to position lights, silks, flags, backdrops, and other tools on a set. C-Stand is believed to be short for Century Stand because they were used in early cinema to hold sun reflectors that were 100 square known as Centuries.</p>', 0, 0, 0, 0, 0, 1, 22, 1, 0, 1, '2023-05-25 05:36:44', '2023-05-25 05:36:44'),
