(37, 'C-Stand', 'rent', 'day', 0, 5, '<p>A C-Stand is a metal stand designed to position lights, silks, flags, backdrops, and other tools on a set. C-Stand is believed to be short for Century Stand because they were used in early cinema to hold sun reflectors that were 100 square known as Centuries.</p>', 0, 0, 0, 0, 0, 1, 22, 1, 0, 1, '2023-05-25 05:37:59', '2023-05-25 05:37:59'),
(38, 'C-Stand', 'rent', 'day', 0, 5, '<p>A C-Stand is a metal stand designed to position lights, silks, flags, backdrops, and other tools on a set. C-Stand is believed to be short for Century Stand because they were used in early cinema to hold sun reflectors that were 100 square known as Centuries.</p>', 0, 0, 0, 0, 0, 1, 22, 1, 0, 1, '2023-05-25 05:38:40', '2023-05-25 05:38:40'),
(39, 'C-Stand', 'rent', 'day', 0, 5, '<p>A C-Stand is a metal stand designed to position lights, silks, flags, backdrops, and other tools on a set. C-Stand is believed to be short for Century Stand because they were used in early cinema to hold sun reflectors that were 100 square known as Centuries.</p>', 0, 0, 0, 0, 0, 1, 22, 1, 0, 1, '2023-05-25 05:40:24', '2023-05-25 05:40:24'),
(40, 'Zoom F8n Pro', 'rent', 'day', 0, 20, '<p>This 8-channel/10-track multitrack field recorder boasts 32-bit float recording technology, yielding you outstanding sound quality, whether you’re working in independent film production, mobile media recording, or any other mission-critical application. You get eight discrete inputs with locking Neutrik connectors, plus high-quality preamps, switchable +4dB mic/line inputs, and balanced analog outputs, along with a highpass filter, a phase invert, and a mid-side decoder. You also get time-code compatibility, a full-color backlit LCD screen, and dual redundant SD/SDHC/SDXC card recording.</p>', 0, 1, 1, 0, 0, 1, 26, 1, 0, 1, '2023-05-26 05:45:06', '2023-05-26 05:45:06'),
(41, 'Zoom F6', 'rent', 'day', 0, 10, '<p>The Zoom F6 is a professional field recorder to featuring both 32-bit float recording and dual AD converters, providing an unprecedented amount of dynamic range. With 6 inputs, Zoom\'s solid time code, multiple power options and wireless control, the F6 is poised to be your new secret weapon.</p>', 0, 0, 0, 1, 0, 1, 26, 1, 0, 1, '2023-05-26 05:47:10', '2023-05-26 05:47:10'),
(42, 'Zoom F-Control', 'rent', 'day', 0, 10, '<p>F-Control is&nbsp;<span style=\"color: rgb(0, 0, 0);\">a mixing control surface that gives filmmakers more control and flexibility when recording in the field</span>. It works alongside the Zoom F8 and F4 to create a complete and professional on-location audio rig.</p>', 0, 0, 1, 0, 0, 1, 26, 1, 0, 1, '2023-05-26 06:31:04', '2023-05-26 06:31:04'),
(43, 'Lectrosonic SRB', 'rent', 'day', 0, 65, '<p>The Lectrosonics SRb5P Camera Slot UHF Receiver (Block 19) is a two-channel slot-mount Digital Hybrid Wireless diversity receiver that supports 486.400 - 511.900 MHz operating frequencies. The SRb5P receiver offers two independent channels and fits into the standard video camera slots found on professional cameras.</p>', 0, 1, 1, 0, 0, 1, 27, 1, 0, 1, '2023-05-26 06:42:50', '2023-05-26 06:42:50'),
(44, 'Lectrosonic SMQV', 'rent', 'day', 0, 45, '<p>Hello World!</p>', 0, 1, 1, 0, 0, 1, 27, 1, 0, 1, '2023-05-26 06:44:28', '2023-05-26 06:44:28'),
(45, 'Lectrosonic SM', 'rent', 'day', 0, 40, '<p>To meet the demand for both extended operating range and extended battery life, this version of the SMQV transmitter offers a selectable output power of 50, 100, or 250 mW. The 50mW option is provided for some theatrical applications, where the system design specifies lower transmitter power. Channel spacing is also selectable, with 100 and 25 kHz options available. With the spacing set to 100 kHz, the SMQV transmitter offers 256 user-selectable UHF frequencies in this block; if that\'s not enough, setting the spacing to 25 kHz gives you up to 1000 frequencies to work with.&nbsp;</p>', 0, 1, 1, 0, 0, 1, 27, 1, 0, 1, '2023-05-26 06:45:32', '2023-05-26 06:45:32'),
(46, 'Sennheiser G4', 'rent', 'day', 0, 15, '<p>A broadcast quality sound solution. Providing the highest flexibility for your outdoor shoots and field recording applications. A robust wireless microphone system that offers excellent sound quality, simple mounting and ease of use.</p>', 0, 0, 0, 1, 0, 1, 28, 1, 0, 1, '2023-05-26 06:48:50', '2023-05-26 06:48:50'),
(47, 'Sennheiser G4', 'rent', 'day', 0, 15, '<p>A broadcast quality sound solution. Providing the highest flexibility for your outdoor shoots and field recording applications. A robust wireless microphone system that offers excellent sound quality, simple mounting and ease of use.</p>', 0, 0, 0, 0, 0, 1, 28, 1, 0, 1, '2023-05-26 06:51:08', '2023-05-26 06:51:08'),
(48, 'Sennheiser G4', 'rent', 'day', 0, 15, '<p>A broadcast quality sound solution. Providing the highest flexibility for your outdoor shoots and field recording applications. A robust wireless microphone system that offers excellent sound quality, simple mounting and ease of use.</p>', 0, 0, 0, 0, 0, 1, 28, 1, 0, 1, '2023-05-26 06:51:39', '2023-05-26 06:51:39'),
(49, 'Sennheiser G4 500', 'rent', 'day', 0, 10, '<p>A broadcast quality sound solution. Providing the highest flexibility for your outdoor shoots and field recording applications. A robust wireless microphone system that offers excellent sound quality, simple mounting and ease of use.</p>', 0, 0, 0, 0, 0, 1, 28, 1, 0, 1, '2023-05-26 07:02:00', '2023-05-26 07:02:00'),
(50, 'Sennheiser G3', 'rent', 'day', 0, 10, '<p>A broadcast quality sound solution. Providing the highest flexibility for your outdoor shoots and field recording applications. A robust wireless microphone system that offers excellent sound quality, simple mounting and ease of use.</p>', 0, 0, 0, 0, 0, 1, 28, 1, 0, 1, '2023-05-26 07:04:25', '2023-05-26 07:04:25'),
(51, 'Sennheiser MKH 50', 'rent', 'day', 0, 25, '<p>Super-cardioid microphone designed for use as a soloist\'s or spot microphone for applications requiring a high degree of side-borne sound muting and feedback rejection. Frequency-independent directional characteristics.</p>', 0, 1, 1, 0, 1, 1, 28, 1, 0, 1, '2023-05-26 07:06:02', '2023-05-26 07:06:02'),
(52, 'Sennheiser MKH 50', 'rent', 'day', 0, 25, '<p>Super-cardioid microphone designed for use as a soloist\'s or spot microphone for applications requiring a high degree of side-borne sound muting and feedback rejection. Frequency-independent directional characteristics.</p>', 0, 0, 0, 0, 0, 1, 28, 1, 0, 1, '2023-05-26 07:06:37', '2023-05-26 07:06:37'),
(53, 'Sennheiser MKH 416', 'rent', 'day', 0, 20, '<p>The venerable MKH 416 is a compact pressure-gradient microphone with short interference tube, highly immune to humidity due to its RF condenser design. Featuring high directivity, low self noise, high consonant articulation and feedback rejection, the MKH 416 can handle difficult exterior filming and reporting conditions without any difficulty. Supercardioid/lobe pattern, matte black finish, supplied with the MZW415 windscreen</p>', 0, 0, 1, 0, 0, 1, 28, 1, 0, 1, '2023-05-26 07:11:52', '2023-05-26 07:11:52'),
(54, 'Rode NTG 3', 'rent', 'day', 0, 10, '<p>The NTG3 is a broadcast-grade shotgun microphone designed for the most demanding shoots that high-resolution broadcast audio. It features RF-bias technology that yields superior resistance to moisture and condensation, making it suitable for outdoor shoots in adverse conditions. The NTG3 has a rich, warm sound and a tightly controlled polar pattern with exceptional off-axis performance with no coloration. It is also highly regarded for voice-over work, where its natural tone and punch deliver exceptional performance for a wide range of voice types.</p>', 0, 0, 0, 0, 0, 1, 30, 1, 0, 1, '2023-05-26 07:13:33', '2023-05-26 07:13:33'),
(55, 'iKan Boom Pole', 'rent', 'day', 0, 5, '<p>The E-Image BC16P Telescoping Boom Pole is specially designed to accommodate Electronic News Gathering (ENG), Electronic Field Production (EFP), documentary, and other field recording applications. Using a telescoping boom pole allows you to place a microphone in close proximity to the subject while remaining at a distance and out of the frame. The BC16P includes an internal coiled XLR cable which removes the hassle of tangling an XLR cable around your boom pole and also makes it easier to extend the boom pole without damaging your XLR cable. The BC16P comes with a side output XLR base so you can easily output to an external recorder.</p>', 0, 0, 0, 0, 0, 1, 29, 1, 0, 1, '2023-05-26 12:44:41', '2023-05-26 12:44:41'),
(56, 'iKan Boom Pole', 'rent', 'day', 0, 5, '<p>The E-Image BC16P Telescoping Boom Pole is specially designed to accommodate Electronic News Gathering (ENG), Electronic Field Production (EFP), documentary, and other field recording applications. Using a telescoping boom pole allows you to place a microphone in close proximity to the subject while remaining at a distance and out of the frame. The BC16P includes an internal coiled XLR cable which removes the hassle of tangling an XLR cable around your boom pole and also makes it easier to extend the boom pole without damaging your XLR cable. The BC16P comes with a side output XLR base so you can easily output to an external recorder.</p>', 0, 0, 0, 0, 0, 1, 29, 1, 0, 1, '2023-05-26 12:46:43', '2023-05-26 12:46:43'),
(57, 'DJI Ronin 1', 'rent', 'day', 0, 30, '<p>The DJI Ronin is designed for use with cine cameras up to 7kg and can also be operated by two operators thanks to a remote control.</p>', 0, 1, 0, 0, 0, 1, 32, 1, 0, 1, '2023-05-28 08:11:15', '2023-05-28 08:11:15'),
(58, 'Ready Rig', 'rent', 'day', 0, 30, '<p>The Ready Rig GS + ProArms features vertical stabilization and reduces bounce motion, providing smoother camera control. By redistributing the weight of a gimbal-mounted or handheld camera setups to your legs and core, this kit enables you to extend your shoot for longer periods of time with less fatigue.</p>', 0, 1, 0, 0, 0, 1, 33, 1, 0, 1, '2023-05-28 08:37:38', '2023-05-28 08:37:38'),
(59, 'Zhiyun Crane 3', 'rent', 'day', 0, 20, '<p>The CRANE 3S features an angled, ergonomic handle that provides two-handed operation for optimal stability. The handle enables you to seamlessly switch to underslung mode, whether with one or two hands, and achieve creative shots such as 330° roll shots as you move closer toward a subject.</p>', 0, 0, 0, 0, 0, 1, 36, 1, 0, 1, '2023-05-30 08:25:28', '2023-05-30 08:25:28'),
(60, 'Moza Air 2', 'rent', 'day', 0, 15, '<p>The Moza Air 2 3-Axis Handheld Gimbal Stabilizer has been upgraded over previous versions with newly optimized high-torque motors, a 9.25 lb weight capacity, and many other features. The high weight capacity allows for a much wider range of cameras to be used, as well as wider combinations of cameras and lenses. The Air 2 also supports the optional Moza iFOCUS Intelligent Wireless Lens Control System, which comes in different versions to offer standard and automatic (with preset start/end points) focus and zoom control directly from the Air 2.</p>', 0, 0, 0, 0, 0, 1, 35, 1, 0, 1, '2023-05-30 08:42:29', '2023-05-30 08:42:29'),
(61, 'Dana Dolly', 'rent', 'day', 0, 25, '<p>The DanaDolly Universal Rental Kit with universal track ends is a heavy duty camera dolly platform that rides on 16 custom modified soft polyurethane wheels that resist flat spotting and use ABEC-7 rated precision bearings providing you with extremely smooth dolly shots.</p>', 0, 0, 0, 0, 0, 1, 34, 1, 0, 1, '2023-05-30 08:46:11', '2023-05-30 08:46:11'),
(62, 'Feiyu A2000 3-Axis Handheld Gimbal', 'rent', 'day', 0, 10, '<p>The Feiyu A2000 3-Axis Handheld Gimbal, a 2-Hand Holder with a joystick, and a Carry Case that fits both items. This kit allows you to use the A2000 by itself the standard way or combine the A2000 and the 2-Hand Holder for full control of the gimbal in two-handed operation. In the latter scenario, the gimbal handle must first be removed.</p>', 0, 0, 0, 0, 0, 1, 37, 1, 0, 1, '2023-05-30 08:57:40', '2023-05-30 08:57:40'),
(63, 'Scrim & Diffuser Kit (24x36)', 'rent', 'day', 0, 15, '<ul><li>	5 x Open-Ended Flag Frames, 1 x Single Black Net, 1/2-Stop</li><li>	1 x Double Black Net, 1-Stop, 1 x Black Light Blocker</li><li>	1 x Silk, 1-Stop &amp; 1 x Silk, 2-Stop, 1 x Single Net Dot, 1/2-Stop (6\")</li><li>	1 x Black Light Blocker Dot (6\"), 1 x Single Net Finger, 1/2-Stop (4x14\")</li><li>	1 x Black Light Blocker Finger (4x14\"), 1 x Carry Case w/ Handles &amp; Compartments</li></ul><p><br></p>', 0, 0, 0, 0, 0, 1, 39, 1, 0, 1, '2023-05-30 09:11:02', '2023-05-30 09:11:02'),
(64, '8’x8’ Diffusion & Flag kit', 'rent', 'day', 0, 25, '<p>Soften, reflect, and tone whatever lighting you encounter with this all-inclusive light control kit. With the modular design of Scrim Jim Cine, this kit can be configured in many different ways. Easily add more diffusion, bounce fabrics, or nets to expand creative possibilities. White, Black, and Green.</p>', 0, 0, 0, 0, 0, 1, 39, 1, 0, 1, '2023-05-30 09:30:41', '2023-05-30 09:30:41'),
(65, '24x36 Flag', 'rent', 'day', 0, 10, '<p>Flags are square or rectangular frames with mounting pins attached. which are used to control natural or artificial light.</p>', 0, 0, 0, 0, 0, 1, 39, 1, 0, 1, '2023-05-30 09:32:44', '2023-05-30 09:32:44'),
(66, '18x24 Flag', 'rent', 'day', 0, 10, '<p>Flags are square or rectangular frames with mounting pins attached. which are used to control natural or artificial light.</p>', 0, 0, 0, 0, 0, 1, 39, 1, 0, 1, '2023-05-30 09:34:15', '2023-06-21 13:08:58'),
(67, 'Atomos Shogun Inferno 7', 'rent', 'day', 0, 20, '<p>The Atomos Shogun Inferno is a 7\", 1920 x 1200 on-camera recording monitor that combines 4K recording with a 10-bit FRC panel that supports native display of HDR (log) footage as well as high-brightness viewing of Rec. 709 footage.</p>', 0, 0, 0, 0, 0, 1, 41, 1, 0, 1, '2023-05-30 09:56:04', '2023-05-30 09:56:04');
