INSERT INTO `movies` (`id`, `media_category_id`, `title`, `description`, `year`, `duration`, `access`, `trailer`, `status`, `number_of_video_ads`, `adult`, `top_scroll`, `new_release`, `upcoming`, `movie_file_type`, `movie_link`, `date_sort`, `user_id`, `contribute_id`, `created_at`, `updated_at`) VALUES
(1, 1, 'Bonded', 'Bonded A Concept Film about what happens to the world after the COVID-19 Pandemic\r\n\r\nStarring: Day\'Quann Ervin, Cordney McClain, Robyn Carter & Jason Fitch\r\nWritten & Directed By: Dekoven Riggins Sr. & Marcus E. Brown\r\n\r\nNOTIS STUDIOS\r\nAn Oklahoma City Based Film Studio.', 2021, '7 min', 'paid', 'https://www.youtube.com/watch?v=CajjdeGk0CY', 1, NULL, 1, 1, 1, 1, 'external_link', 'https://notisstreaming.s3.us-east-2.amazonaws.com/Movies/Bonded_Concept_Film_2021_1080p.mp4', '2023-01-15 17:30:00', 1, -1, '2023-01-16 22:30:50', '2024-03-16 14:15:59'),
(5, 1, 'Black Wall Street Burning Directors Cut', 'What Happens When Racism Fuels A Small Misunderstanding?\r\nNotis Studios Presents: Black Wall Street Burning\r\nStarring - Day\'Quann Ervin, Cordney McClain, Mitch Yoder, Adam Modisette, & Robyn Carter\r\nWritten By: Dekoven Riggins, Directed By: Dekoven Riggins & Marcus E. Brown', 2022, '1 hour 42 min', 'paid', 'https://www.youtube.com/watch?v=EZ79rkOAljI', 1, NULL, 1, 1, 0, 0, 'external_link', 'https://notisstreaming.s3.us-east-2.amazonaws.com/Movies/BlackWallStreetBurningDC.mp4', '2023-04-15 01:00:00', 1, 12, '2023-04-16 05:41:47', '2024-03-25 19:27:42'),
(6, 1, 'Cakin', 'Remember when staying on the phone all night talking to that special someone. Well we are taking you back to 1999 when cakin was a thing.', 2023, '9:32', 'paid', 'https://youtu.be/sHo8q2WuEHg', 1, NULL, 0, 1, 1, 0, 'external_link', 'https://notisstreaming.s3.us-east-2.amazonaws.com/Movies/Cakin+Full+Short+MP4.mp4', '2024-03-21 10:00:00', 1, -1, '2024-03-16 14:28:53', '2024-03-22 19:15:57'),
(7, 1, 'Reversal', 'In 2022, racism is still alive and well but not how you think. Come with us as we look into the lives of white and black Americans; and the way the world would look  with Black Americans in the driver\'s seat for all of American history.', 2022, '28m 05s', 'paid', 'https://www.youtube.com/watch?v=j3MlOkbXdb0', 1, NULL, 0, 0, 0, 0, 'external_link', 'https://notisstreaming.s3.us-east-2.amazonaws.com/Reversal_Stereo.mp4', '2023-01-21 07:53:00', 1, -1, '2024-03-16 14:52:04', '2024-03-22 19:13:56'),
(8, 8, 'OseiTest', 'This is just a test', 2023, '50min', 'paid', 'https://www.youtube.com/watch?v=j3MlOkbXdb0', 1, NULL, 0, 0, 0, 0, 'external_link', 'https://notisstreaming.s3.us-east-2.amazonaws.com/Movies/Cakin+Full+Short+MP4.mp4', '2024-03-18 02:56:00', 1, -1, '2024-03-18 16:36:31', '2024-03-20 17:33:14'),
(9, 1, 'Neurosis Movie', 'Tyrell, a successful C-Suite Executive, suddenly finds himself at the center of a terrifying plot guided by a mysterious character who holds deadly secrets close to heart. The nefarious caller invokes a plan that takes our hero on a nail-biting mission of espionage, manipulation and more- with lives hanging in the balance. Every decision Tyrell makes, is a life-or-death choice!', 2024, '2hrs 10m', 'paid', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/g-7CIonKSRs?si=Tyx6sBLRvZDo4A9w\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" referrerpolicy=\"strict-origin-when-cross-origin\" allowfullscreen></iframe>', 1, NULL, 0, 1, 1, 0, 'external_link', 'https://notisstreaming.s3.us-east-2.amazonaws.com/Movies/Neurosis1080P-OSEI.mp4', '2024-03-21 01:30:00', 1, -1, '2024-03-22 19:31:23', '2024-03-25 21:42:35');
