INSERT INTO `rooms` (`id`, `name`, `number`, `dimension`, `price_type`, `price_hourly`, `price_daily`, `price_3`, `price_6`, `price_9`, `price_12`, `status`, `description`, `top_bar`, `featured`, `new_arrival`, `best_selling`, `top_rated`, `special_request`, `category_id`, `created_at`, `updated_at`) VALUES
(4, 'Podcast Room', '4', '169+ sqft', 'hour', 75, 0, NULL, NULL, NULL, NULL, 1, '<p>Make your podcast needs come to life with the perfect set up to record your show. Room comes equipped with and array of recording supplies to include microphones, Large table/desk set up, chairs, high speed internet. This space can accommodate up to x number of people . (2 hour minimum )</p><p><br></p><ul><li>Additional services available include: post production mixing and mastering suit rental available on site. For additional equipment rental such as cameras and additional microphones use special request drop down.</li></ul><p><br></p><p><br></p>', 0, 0, 1, 0, 0, 1, NULL, '2023-03-20 21:13:14', '2023-03-25 01:42:42'),
(5, 'Conference Room', '3', '247 sqft', 'hour', 25, 0, 0, 0, 0, 0, 1, '<p>Hold meetings up to # people (lecture style) Conference room comes equipped with smart board, smart TV with screen sharing capabilities,… Large conference table with 8 chairs. Ideal place for dual in person/ virtual meeting options.&nbsp;</p><p><br></p><p>Use special request drop down for daily rate</p>', 1, 0, 0, 0, 0, 1, NULL, '2023-03-24 15:37:34', '2023-04-21 14:39:18'),
(6, 'Theater', '1', '392 sqft', 'hour', 25, 0, 0, 0, 0, 0, 1, '<p>Host a private screening for up to<strong> </strong>20 guest. Theater comes equipped with 9.1.6 Dolby Atmos surround sound, 150-inch screen, and 20 theater seats.&nbsp;Host private film events such as private parties, indie film premiers, screenings for investors, cast screenings, quality control check for your indie film and more.</p><p><br></p><p>For daily rate and special request please use drop down.</p><p><br></p><p>Concessions currently unavailable.&nbsp;</p>', 1, 1, 0, 0, 0, 1, NULL, '2023-03-25 01:09:26', '2023-05-23 13:10:51'),
(7, 'Sound Stage', '2', '2000+ sqft', 'both', 99, 349, NULL, NULL, NULL, NULL, 1, '<p>Large indoor studio perfect for the indie filmmaker. Sound stage comes equipped with cyc wall, dimensions are… equipment that comes included with stage rental is… Other equipment rental available at additional cost. On site mens dressing room, womens dressing room, an area for hair and makeup, lounge, and break room.&nbsp;</p><p><br></p><p>Use special request drop down for weekly and monthly rates.</p><p><br></p><p><br></p>', 1, 1, 0, 1, 1, 1, NULL, '2023-03-25 01:16:01', '2023-04-02 07:15:42'),
(8, 'Office Space', '5', 'TBD', 'monthly', 0, 0, 10, 20, 30, 40, 0, '<p><strong>3, 6, 9 or 12 month lease available. Each room is equipped with a 5x2 desk, computer, high speed WIFI access. All bills paid. Perfect for …</strong></p><p><br></p><p><strong>Office Space #1: </strong>Music production office&nbsp;</p><p><strong>Office Space #2: </strong>Editing and color grading<strong>&nbsp;</strong></p><p><strong>Office Space #3: </strong>Audio production<strong>/</strong>sound mixing</p><p><strong>Office Space #4: </strong>Office space</p><p>Customize your work space by adding your own flare and flavor.&nbsp;</p><p><br></p><p>Amenities: On site shared break room with refrigerator, Stove, Microwave and eating area.&nbsp;</p>', 1, 1, 1, 0, 0, 0, NULL, '2023-03-25 01:41:59', '2023-04-21 14:40:32'),
(9, 'The Spot- Music Studio', '6', 'TBD', 'hour', 65, 0, 0, 0, 0, 0, 1, '<p>Music production studio equipped with 88 weighed keyboard, Logic Pro X, a Neumann u87 mic and a Native Instrument Maschine. </p>', 1, 1, 1, 1, 1, 1, NULL, '2023-03-25 01:45:33', '2023-05-23 13:26:29'),
(10, 'Sound Design', '7', '252 sqft', 'both', 80, 249, 0, 0, 0, 0, 1, '<p>9.1.6 Dolby Atmos, acoustically treated, Ideal for top tier audio editing and sound mixing for movies, podcasts, audiobooks, voice overs and more</p>', 1, 1, 1, 1, 1, 1, NULL, '2023-03-25 01:49:11', '2023-05-24 10:29:26'),
(11, '4 Eyez Editing', '8', 'TBD', 'both', 80, 249, 0, 0, 0, 0, 1, '<p>Coming Soon for all your post production editing and color grading needs. Access to davanci resolve and final cut pro.</p>', 1, 1, 1, 0, 1, 1, NULL, '2023-03-25 01:54:24', '2023-05-23 13:30:47'),
(12, 'VFX', '9', 'TBD', 'both', 50, 199, 0, 0, 0, 0, 1, '<p>Coming Soon ...</p>', 1, 1, 0, 0, 0, 1, NULL, '2023-03-25 02:02:48', '2023-04-21 14:43:37');
