(5, 'Skinz League 2023', 'The 2023 Pro-Am Skinz League will showcase these teams: Bisons, How High, Trifecta, Savages, GMB, Goat, Jumpman, Bucket Fam, OTM, A-Town, Chasing Wolves, GTA, HeadTap, Rocafella, and Team Equip.', 2023, 'Skinz League', 1, 0, 1, 1, 1, '2023-06-24 19:00:00', 1, 5, '2023-06-25 10:32:27', '2024-03-18 14:49:21'),
(8, 'Investing In Love - Season 1', 'A show about the opportunity to build generational wealth, supported by a strong foundation of love, legacy, and family values.', 2023, 'https://youtu.be/xeAXxXxk_AI', 1, 0, 0, 0, 0, '2023-12-01 12:00:00', 1, 10, '2024-03-25 19:53:01', '2024-03-25 20:34:41'),
(9, 'Marriage Is? - Season 2', 'Welcome to Season 2 of \"Marriage Is?\"—the groundbreaking reality TV show that delves deep into the complexities of modern-day relationships! In this riveting season, we bring together four married couples for candid round table discussions on the most pivotal topics affecting marriages today. From the secrets of success to reigniting the flame, managing finances, and navigating conflicts with grace, no stone is left unturned.\r\n\r\nJoin us as these couples bare their souls, sharing their triumphs, trials, and intimate insights into what makes their marriages work—or struggle. With raw honesty and unwavering vulnerability, they tackle the toughest questions, offering viewers a rare glimpse into the inner workings of real-life partnerships.\r\n\r\nFrom heartwarming moments of connection to fiery debates and unexpected revelations, \"Marriage Is?\" Season 2 promises to be a rollercoaster ride of emotions. Whether you\'re single, in a relationship, or married yourself, prepare to be inspired, challenged, and empowered by the unfiltered wisdom and authenticity of these courageous couples.\r\n\r\nSo grab a seat at the table and join the conversation as we explore the true meaning of love, commitment, and what it takes to make a marriage thrive in today\'s world. Because when it comes to love, \"Marriage Is?\" more than just a journey—it\'s an adventure of a lifetime.', 2024, 'https://youtu.be/tqbwUwO3TXA', 1, 1, 1, 1, 0, '2024-02-15 00:00:00', 1, 1, '2024-03-25 20:29:34', '2024-03-25 20:34:10');
